INSERT INTO `aboutus` (`id`, `os_title`, `os_desc`, `os_img`, `ms_title`, `ms_desc`, `ms_img`, `ms_img1`, `wo_title`, `wo_desc`, `wo_img`, `jn_title`, `jn_desc`, `jn_bttitle`, `jn_btlink`, `uass_city1`, `uass_list1`, `uass_file1`, `uass_city2`, `uass_list2`, `uass_file2`, `uass_city3`, `uass_list3`, `uass_file3`, `uass_city4`, `uass_list4`, `uass_file4`) VALUES
(8, 'OUR HISTORY', 'Prof. Adarsh Bhatti, a well known teacher of chemistry&nbsp;for IIT-JEE /NEET/AIIMS with an experience of 29 years started the FIRST Institute of its own kind in Jalandhar - NBS GURUKUL in the year 2002, with a dream to start a center of excellence for coaching of IIT-JEE (MAINS &amp; ADVANCED) /AIPMT/NEET/X+2 Medical/Non-Medical under one roof.<br><br>NBS Gurukul has over the past 17 years made many humble yet significant contributions to the competitive exams preparation space. It has fulfilled its dream &amp; vision of creating a center of excellence, under one roof for the coaching of various competitions such as IIT-JEE (Mains &amp; Advanced)/NEET. Here the best teachers and the best facilities come together to educate, encourage and prepare the students to face the challenge of state boards and entrance test effectively. <br>', 'about2.jpg', 'OUR MISSION', 'With changing times,In 2016, Prof. Adarsh Bhatti Started LIVE ONLINE INTERACTIVE COACHING under the name &amp; style of STUDYROCKS to cater to new young generation of INDIA. At present, we are teaching students at many locations such as New Delhi, Bombay, Calcutta, Chandigarh. Covering states such as Punjab, Haryana, Himachal, Jammu &amp; Kashmir, Uttrakhand, West Bengal, Rajasthan. <br><br>On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment, that they cannot foresee the pain and trouble that are bound to ensue; and equal blame belongs to those who fail in their duty.<br>', 'mission1.jpg', 'mission2.jpg', 'WHAT WE ARE OFFERING', 'LIVE &amp; RECORDED INTERACTIVE VIDEO LECTURES OF EXPERT &amp; QUALIFIED TEACHERS.<br>GRADED APPROACH<br>STARTING FROM BASIC LEVEL THEN BUILDING UP TO BOARD/ MAINS/ NEET/ ADVANCED<br>ANIMATION &amp; VIDEOS<br>PROVIDING HUMAN TOUCH TO TECHNOLOGY<br>', '$scnof_filename', 'STUDYROCKS MAKING EDUCATION BETTER', 'EXCELLENT RESULTS OF NBS GURUKUL (From 2002-2019) SELECTIONS :154, NIT :720, AIMPT/NEET :602.', 'STUDYROCKS MAKING EDUCATION BETTER', '#', 'Jalandhar ', '<ul><li>MERITORIOUS SCHOOL, JALANDHAR&nbsp;</li><li>GGSSS NEHRU GARDEN, JALANDHAR&nbsp;</li><li>GSSS LADOWALI ROAD, JALANDHAR</li><li>GSSS CO-ED LADOWALI ROAD, JALANDHAR</li><li>GSSS PAP COMPLEX, JALANDHAR</li><li>GSSS GAKHAL DHALIWAL, JALANDHAR</li><li>INNOCENT HEARTS, JALANDHAR</li><li>CT PUBLIC SCHOOL, JALANDHAR</li><li>MGN PUBLIC SCHOOL,UE II, JALANDHAR</li></ul>', 'india.png', 'Others ', '<ul><li>MERITORIOUS SCHOOL, LUDHIANA&nbsp;</li><li>\r\nMERITORIOUS SCHOOL, PATIALA&nbsp;</li><li>\r\nMERITORIOUS SCHOOL, MOHALI&nbsp;</li><li>\r\nMERITORIOUS SCHOOL, BATHINDA&nbsp;</li><li>\r\nSVM, MALERKOTLA&nbsp;</li><li>\r\nBERRY\'S GLOBAL DISCOVERY, MALSIAN&nbsp;</li><li>\r\nAPEX SCHOOL, FATHEABAD(HARYANA)&nbsp;</li><li>\r\nARMY PUBLIC SCHOOL, BEAS&nbsp;</li><li>\r\nCAMBRIDGE INTERNATIONAL, DASUYA&nbsp;</li></ul>', 'india.png', '', '', '', '', '', '$scnass3_file');
