INSERT INTO `homeabout` (`id`, `title`, `description`, `name`, `study`, `position`, `photo`) VALUES
(1, 'ABOUT US', '<div>Prof. Adarsh Bhatti, a well known teacher of chemistry for IIT-JEE /NEET/AIIMS with an experience of 30 years started the FIRST Institute of its own kind in Jalandhar - NBS GURUKUL in the year 2002, with a dream to start a center of excellence for coaching of IIT-JEE (MAINS &amp; ADVANCED) /AIPMT/NEET/X+2 Medical/Non-Medical under one roof.<br><br></div><div>With changing times , in 2016, Prof. Adarsh Bhatti Started LIVE ONLINE INTERACTIVE COACHING under the name &amp; style of STUDYROCKS to cater to new young generation of INDIA. At present, we are teaching students at many locations such as -New Delhi, Bombay, Calcutta, Chandigarh. Covering states such as Punjab, Haryana, Himachal, Jammu &amp; Kashmir, Uttrakhand, West Bengal, Rajasthan.</div>', 'Prof. Adarsh Bhatti', ' M.Sc. (Gold Medalist)', 'Founder Director', 'about2.jpg');
