INSERT INTO `testimonials` (`id`, `name`, `description`, `photo`) VALUES
(44, 'Parul Berry', 'I feel happy to share that I am associated with STUDYROCKS since my NTSE days & qualified NTSE Stage I & II both because of STUDYROCKS. It’s a proud moment for me to qualify AIIMS with AIR 30. NEET with AIR 47 & JIPMER with AIR 20. I give credit for this to PROF.ADARSH BHATTI (Chemistry) for helping me to solve my tough problems whenever I approached him.', 'PARUL BERRY.jpeg'),
(45, 'Ratulbir Goyal', 'Today I am proud of my decision of joining STUDYROCKS as I scored 97.1% marks in my board exams, got 14th rank in Punjab & I’m selected in PMT. The credit of my success in boards as well as in competition entrance exam perfectly goes to STUDYROCKS. STUDYROCKS is really an ideal temple of learning in the age of commercial education.', 'RATULBIR GOYAL.jpg'),
(46, 'Roopanjot Kaur', 'Knowledge not only means knowledge about subject. It includes an overall development of the students as we are the future of the country, and STUDYROCKS works on the same. It helps the students in every way they can. It always supports us whenever we feel low. So I prefer this place & I am very proud of being part of STUDYROCKS. ', 'RUPANJOT KAUR.jpeg'),
(47, 'Mansi Nayyar', 'STUDYROCKS is the place that teaches it’s students How to think & turn the tragedy of books into pleasure. I am privilege to have been the part of this prestigious institute. In nutshell I would say that it takes big hearts to inspire & to shape little minds. They set out to reach for each individual & work to matchup those needs that suits them. A heartiest thanks to STUDYROCKS.', 'MANSI NAYYAR.jpg'),
(48, 'Sahil Syal', 'I am very happy to share my reviews regarding STUDYROCKS. According to me STUDYROCKS is the full package of knowledge under one roof. The study material provided here is not of national level, but of international level. It is the best institute not only in Jalandhar but in INDIA. I am very proud to be the part of STUDYROCKS', 'SAHIL SYAL.jpeg'),
(50, 'Ashutosh Singh', 'I am part of STUDYROCKS family for last many years. A very friendly environment is maintained in this institution. We can share views & doubts with teachers with no hesitation. As far as the quality of education is concerned, it will obviously take you to the international level. I am very thankful to STUDYROCKS, It is not only an institute but a family also.  ', 'ASHUTOSH SINGH.jpeg'),
(52, 'Tarun Kapoor', 'I am very happy & excited to share that the years I spent with STUDYROCKS has been very blooming & boosting for me. STUDYROCKS is a place where nothing but loudness of quality education speaks. This is the only place which teaches us that self confidence, confidence upon our teachers & silently loud hard work is the only way to success. ', 'TARUN KAPOOR.jpg'),
(53, 'Gurleen Kaur', 'Prof.Adarsh Bhatti a very generous teacher made us feel motivated during every class. Till 10th class, my chemistry was not at all strong, but after joining STUDYROCKS I really feel that my chemistry base is becoming strong. Even my school teachers appreciated me alot for my improved chemistry concepts & it is all because of STUDYROCKS.', 'GURLEEN KAUR.jpeg'),
(54, 'Taranjot Kaur', 'I feel happy to share that I am associated with STUDYROCKS since 2018. Here all teachers are very experienced, talented & motivated. It is the place where I got to know that what the actual learning is. I give all the credit of my success to Prof.Adarsh Bhatti as he always helped me whenever I approached him for my doubts. I am very happy being part of STUDYROCKS.', 'TARANJOT KAUR.jpeg');
